import React, { useState, useEffect } from 'react'
import PropTypes from 'prop-types'


export default function NavBar(props) {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [btnstyle,setBtnStyle]=useState({
    color:'white',
    backgroundColor:'black'
  });
  const [borderstyle,setBorderStyle]=useState({
    borderstyle:'2px solid black',
  });
  const [txtstyle,setTextStyle]=useState({
    color:'white',
  });
  const handleDarkModeToggle = () => {
    setIsDarkMode(!isDarkMode);
  };

  useEffect(() => {
    // Apply dark mode styles when component mounts
    if (isDarkMode) {
      setTextStyle({
        color:'white',
      })
      setBorderStyle({
        color:'white',
      })
      setBtnStyle({
        color:'white',
        backgroundColor:'black'
      })
      document.body.style.backgroundColor = 'black';
      document.body.style.color = 'white';
    } else {
      setTextStyle({
        color:'black',
      })
      setBorderStyle({
        color:'black',
      })
      setBtnStyle({
        color:'black',
        backgroundColor:'white'
      })
      document.body.style.backgroundColor = 'white';
      document.body.style.color = 'black';
    }

    // Clean up styles when component unmounts
    return () => {
      document.body.style.backgroundColor = '';
      document.body.style.color = '';
    };
  }, [isDarkMode]);

    return(
        <nav className={`navbar navbar-expand-lg ${isDarkMode ? 'dark-mode' : 'light-mode'}`}>
    <div className="container-fluid" >
      <a className="navbar-brand" href="/" style={txtstyle}>
        <img src="https://whatthelogo.com/storage/logos/frank-millers-300-8841.png" alt="Logo" width="150" height="50" className="d-inline-block align-text-top"/>
        {props.name}
      </a>
      <div className="collapse navbar-collapse" id="navbarNavDropdown">
        <ul className="navbar-nav">
          <li className="nav-item">
            <a className="nav-link active" style={txtstyle} aria-current="page" href="/about">Spartan Abode</a>
          </li>
          <li className="nav-item">
            <a className="nav-link active" style={txtstyle} aria-current="page" href="/testimonial">Testimonials</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#" style={txtstyle}>Perks</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#" style={txtstyle}>Pricing</a>
          </li>
          <li className="nav-item dropdown" style={txtstyle} data-bs-theme="dark">
            <button type="button" className="btn btn-danger dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
              Historic Places
            </button>
            <ul className="dropdown-menu" style={txtstyle} aria-labelledby="dropdownMenuButtonDark">
              <li><a className="dropdown-item" style={btnstyle} href="https://www.gtp.gr/TDirectoryDetails.asp?ID=14991">Acropolis</a></li>
              <li><a className="dropdown-item" style={btnstyle} href="https://en.wikipedia.org/wiki/Menelaion">Menelaion</a></li>
              <li><a className="dropdown-item" style={btnstyle} href="https://en.wikipedia.org/wiki/Mystras">Mystras</a></li>
              <li><a className="dropdown-item" style={btnstyle} href="https://en.wikipedia.org/wiki/Taygetus">Taygetus</a></li>
              <li><hr style={borderstyle} className="dropdown-divider"/></li>
              <li><a className="dropdown-item" style={btnstyle} href="#">Uncharted Waters</a></li>
            </ul>
          </li>
        </ul>
      </div>
      <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn-search" type="submit">Search</button>
      </form>
      <button className='btn' style={btnstyle} onClick={handleDarkModeToggle}>{isDarkMode ? 'Light Mode' : 'Dark Mode'}</button>
    </div>
  </nav>
    )
}

NavBar.propTypes={
    name:PropTypes.string.isRequired,
}

NavBar.defaultProps={
    name:'Set App Name here',
};
